import React from 'react';
import './home-page.scss';

const Home = () => {
    return (
        <div className="home-page">
            <nav className="navbar navbar-light bg-dark">
                <a className="navbar-brand" href="#">
                    <div className="logo"><strong> [ </strong>Smart<strong>Code ]</strong></div>
                </a>
                <div className="links">
                    <span>Home</span>
                    <span>Services</span>
                    <span>Projects</span>
                </div>
            </nav>
        </div>
    )
}

export default Home;
